import React from 'react'

import './HomePage.css';

import 'bootstrap/dist/css/bootstrap.min.css'

import ListPokemon from './Components/ListPokemon';




class HomePage extends React.Component{



  
  

  render(){

    return (
      
      <div className='main'>
        <img src="https://cdn.bulbagarden.net/upload/4/4b/Pok%C3%A9dex_logo.png" alt="Girl in a jacket" style={{marginLeft:"40%"}} ></img>
        <div className="list">
          <ListPokemon/>
        </div>
      </div>
      
    );
  }






  }
export default HomePage;
